import * as React from 'react';
// import './ListCars.css';
import CardCars from './CarsCard'
import CarsCard from './CarsCard';

const ListCars = ({ cars }) => (
    <div className="row">
        <CarsCard urlImage={cars[0].picturePath} brand={cars[0].brand} model={cars[0].model} pricePerDay={cars[0].pricePerDay} pricePerKm={cars[0].pricePerKm} maxDuration={cars[0].availability.maxDuration} maxDistance={cars[0].availability.maxDistance} />
        <CarsCard urlImage={cars[0].picturePath} brand={cars[0].brand} model={cars[0].model} pricePerDay={cars[0].pricePerDay} pricePerKm={cars[0].pricePerKm} maxDuration={cars[0].availability.maxDuration} maxDistance={cars[0].availability.maxDistance} />
        <CarsCard urlImage={cars[0].picturePath} brand={cars[0].brand} model={cars[0].model} pricePerDay={cars[0].pricePerDay} pricePerKm={cars[0].pricePerKm} maxDuration={cars[0].availability.maxDuration} maxDistance={cars[0].availability.maxDistance} />
        <CarsCard urlImage={cars[0].picturePath} brand={cars[0].brand} model={cars[0].model} pricePerDay={cars[0].pricePerDay} pricePerKm={cars[0].pricePerKm} maxDuration={cars[0].availability.maxDuration} maxDistance={cars[0].availability.maxDistance} />
        <CarsCard urlImage={cars[0].picturePath} brand={cars[0].brand} model={cars[0].model} pricePerDay={cars[0].pricePerDay} pricePerKm={cars[0].pricePerKm} maxDuration={cars[0].availability.maxDuration} maxDistance={cars[0].availability.maxDistance} />
    </div>

);
export default ListCars;
